import React from "react";
import styled from "styled-components";

const Div = styled.div`
  background: #f4f4f4;
  height: 100vh;

  @media (max-width: 426px) {
    height: 32vh;
  }

  @media (min-height: 1365px) {
    height: 17vh;
  }
`;

const Li = styled.li`
  list-style: none;
  margin-top: 13px;
  cursor: pointer;
`;

const H3 = styled.h3`
  margin-bottom: 35px;
  padding-top: 25px;
  cursor: pointer;
`;

const Div2 = styled.div`
  margin-left: 20px;
`;

const Aside = () => {
  return (
    <div>
      <Div>
        <Div2>
          <H3>MI CUENTA</H3>
          <ul>
            <Li>
              <strong>MIS PRODUCTOS FAVORITOS</strong>
            </Li>
            <Li>Mis compras</Li>
            <Li>Mi cuenta</Li>
            <Li>Cerrar sesi√≥n</Li>
          </ul>
        </Div2>
      </Div>
    </div>
  );
};

export default Aside;
